import React from 'react';

const styles = {
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  ul: {
    listStyleType: 'none',
    display: 'flex',
  },
  li: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  login: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
  },
  program1Section: {
    display: 'flex',
    alignItems: 'center',
    padding: '50px',
  },
  image: {
    maxWidth: '200px',
    maxHeight: '300px',
    marginRight: '50px',
  },
  content: {
    textAlign: 'left',
  },
};

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.ul}>
      <li style={styles.li}>Home</li>
      <li style={styles.li}>About Us</li>
      <li style={styles.li}>Services</li>
      <li style={styles.li}>Contact</li>
    </ul>
    <div style={styles.login}>Login</div>
  </nav>
);

const Program1Section = () => (
  <div style={styles.program1Section}>
    <img src="https://via.placeholder.com/200x300" alt="Program 1 Image" style={styles.image} />
    <div style={styles.content}>
      <h2>Program 1</h2>
      <p>This is some content about Program 1. You can add more details here.</p>
    </div>
  </div>
);

const Footer = () => (
  <footer style={{ backgroundColor: '#333', color: 'white', padding: '30px', width: '100%' }}>
    {/* Footer Content */}
  </footer>
);

const EmptyPage = () => (
  <div>
    <NavBar />
    <Program1Section />
    <Footer />
  </div>
);

export default EmptyPage;
